#include <iostream>
#include <queue>
#include <string>

#include "utility.hpp"
using namespace std;

int main() {
    string s = "";
    int count[26] = {0};
    for (int i = 0; i < s.length(); i++) {
        if (i >= 4) {
            bool valid = true;
            for (int val : count) {
                if (val > 1) {
                    valid = false;
                    break;
                }
            }

            if (valid) {
                cout << i << endl;
                break;
            }
        }

        count[s[i] - 'a']++;
        if (i >= 4) count[s[i - 4] - 'a']--;
    }
}